import React from "react";
import DisplayRandomRune from "../components/DisplayRandomRune";

const Home = (props) => {
  return (
    <section className="hero">
      <div className="hero-body">
        <div className="container has-text-centered">
          <div className="block">
            <DisplayRandomRune width="100%" height="100%" />
          </div>
          <p className="title">NEO FTW</p>
          <p className="subtitle">
            N3 migration soon. Building something cool.
          </p>
          <a
            className="has-text-grey-darker"
            href={"https://forthewinn.github.io/legacy-app"}
          >
            <small>Neo-legacy archive</small>
          </a>
        </div>
      </div>
    </section>
  );
};

export default Home;
